import React from 'react';

function Article(props) {
    const {article} = props;

    return (
        <div>
            <header>
                {article.title}
            </header>
            <article>
                {article.content}
            </article>
            <footer>
                {article.createdAt}
            </footer>
        </div>
    )
}

export default Article;
